import {createRouter, createWebHistory} from "vue-router";
import Login from './pages/Login.vue'
import GestorServicos from './components/GestorServicos.vue'
import Servicos from './pages/Servicos.vue'
import Perfil from './pages/Perfil.vue'

const router = createRouter({
    history: createWebHistory(),
    routes: [
        { path: '/', component: Login},
        { path: '/servico/:catchAll(.*)', component: GestorServicos},
        { path: '/servicos/:catchAll(.*)', component: Servicos},
        { path: '/perfil/:catchAll(.*)', component: Perfil},
        { path: '/:notFound(.*)', redirect: '/'}
    ]
});

export default router;
